import React from "react";
import { Route, Link } from "react-router-dom";

const home = (props) => {
    let history = useHistory();
    return (

        <div className="home">
            <h1>내 일주일은?</h1>
            <div className='row'>
                <p>금</p>
                <div className='score'></div>
                <div className='score'></div>
                <div className='score'></div>
                <div className='score'></div>
                <div className='score'></div>
                <button onclick={() => history.pushState("/edit")}>편집하기</button>
            </div>
        </div>
    )
}

export default home;
